import Btnlg from '../components/btn/Btnlg';

function Mode() {
    return (
        <section>
            <div className="mode">
                <div className="btnDelete">
                    <Btnlg type="submit" className="btn" caracteristique="lg" text="Supprimer ce compte"/>
                </div>
            </div>
        </section>
    );
  }

  export default Mode;
